  true,\n\t\"url\": null,\n\t\"notes\": \"Planetary nomenclature, like terrestrial
  nomenclature, is used to uniquely identify a feature on the surface of a planet
  or satellite so that the feature can be easily located, described, and discussed.
  This gazetteer contains detailed information about all names of topographic and
  albedo features on planets and satellites (and some planetary ring and ring-gap
  systems) that the International Astronomical Union (IAU) has named and approved
  from its founding in 1919 through the present time.\",\n\t\"license_title\": \"U.S.
